def fibfib(n: int):
    if n == 0:
        return 0
    if n == 1:
        return 0
    if n == 2:
        return 1
    a, b, c = 0, 0, 1
    for i in range(3, n + 1):
        a, b, c = b, c, a + b + c
    return c
```

The function computes the n-th element of the FibFib number sequence efficiently by utilizing a loop to calculate the values based on the given recurrence relation.

