import hashlib

def string_to_md5(text):
    if text == "":
        return None
    else:
        md5_hash = hashlib.md5(text.encode()).hexdigest()
        return md5_hash
```

This function takes a string input `text`, converts it to its MD5 hash equivalent using the hashlib library, and returns the hashed string. If the input string is empty, it returns `None`.

